import React, { useState } from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import HeaderName from './component/HeaderName'

import './App.css';


const App = () => (
  <Container fluid style={{background:"black"}}>
    <Row>
      <Col style={{borderColor:"white"}} xs={2}>
        <HeaderName/>
      </Col>
      <Col style={{borderColor:"white"}} xs={10}>2 of 2</Col>
    </Row>
    <Row>
      <Col style={{borderColor:"white"}}>1 of 3</Col>
      <Col style={{borderColor:"white"}}>2 of 3</Col>
      <Col style={{borderColor:"white"}}>3 of 3</Col>
    </Row>
  </Container>
);

export default App;
